actions:
- deploy:
    images:
      rootfs: {compression: gz, image_arg: '-drive format=raw,file={rootfs}', url: 'http://images.validation.linaro.org/kvm/standard/large-stable-6.img.gz'}
    os: debian
    root_partition: 1
    timeout: {minutes: 10}
    to: tmpfs
- boot:
    auto_login: {login_prompt: 'login:', username: root}
    media: tmpfs
    method: qemu
    prompts: ['root@debian:']
    timeout: {minutes: 3}
- test:
    definitions:
    - from: inline
      name: env-dut-inline
      path: inline/env-dut.yaml
      repository:
        metadata: {description: Basic system test command for Linaro Ubuntu images,
          format: Lava-Test Test Definition 1.0, name: smoke-tests-basic}
        run:
          steps: [printenv]
    - {from: git, name: smoke-tests, path: lava-test-shell/smoke-tests-basic.yaml,
      repository: 'http://git.linaro.org/lava-team/lava-functional-tests.git'}
    - {from: git, name: singlenode-advanced, path: lava-test-shell/single-node/singlenode03.yaml,
      repository: 'http://git.linaro.org/lava-team/lava-functional-tests.git'}
    timeout: {minutes: 10}
context: {arch: amd64}
device_type: qemu
job_name: qemu-amd64-standard-jessie
metadata: {path: shared/health-checks/qemu.yaml, source: 'https://git.linaro.org/lava/lava-lab.git'}
priority: medium
timeouts:
  action: {minutes: 10}
  job: {minutes: 20}
visibility: public

